INSERT OVERWRITE INTO sf_employees
  SELECT * FROM employees
  WHERE city = 'San Francisco';

WITH basic_example(i_col, j_col) AS (
    SELECT * FROM VALUES
        (11, 101), (11, 102), (11, NULL), (12, 101), (NULL, 101), (NULL, 102)
)
SELECT COUNT_IF(TRUE) FROM basic_example;

WITH basic_example(i_col, j_col) AS (
    SELECT * FROM VALUES
        (11, 101), (11, 102), (11, NULL), (12, 101), (NULL, 101), (NULL, 102)
)
SELECT COUNT_IF(j_col > i_col) FROM basic_example;

WITH basic_example(i_col, j_col) AS (
    SELECT * FROM VALUES
        (11, 101), (11, 102), (11, NULL), (12, 101), (NULL, 101), (NULL, 102)
)
SELECT COUNT_IF(i_col IS NOT NULL AND j_col IS NOT NULL) FROM basic_example;

CREATE OR REPLACE TABLE test_time (
    id INTEGER,
    event_time TIME(3)
);

CREATE OR REPLACE TABLE test_byteint (
    id INTEGER,
    byte_count BYTEINT
);

WITH TEMP_TABLE AS (
  SELECT column1 
  FROM VALUES (1), (null), (5), (0), (3.14159)
)
SELECT column1, ZEROIFNULL(column1) 
FROM TEMP_TABLE;

WITH simulated_infer_schema AS (
    SELECT 'country' AS COLUMN_NAME, 'VARIANT' AS TYPE, TRUE AS NULLABLE
    UNION ALL
    SELECT 'continent', 'TEXT', TRUE
)
SELECT GENERATE_COLUMN_DESCRIPTION(
    ARRAY_AGG(OBJECT_CONSTRUCT('COLUMN_NAME', COLUMN_NAME, 'TYPE', TYPE, 'NULLABLE', NULLABLE)), 'table'
) AS COLUMNS
FROM simulated_infer_schema;

WITH simulated_infer_schema AS (
    SELECT 'country' AS COLUMN_NAME, 'VARIANT' AS TYPE, TRUE AS NULLABLE
    UNION ALL
    SELECT 'continent', 'TEXT', TRUE
)
SELECT GENERATE_COLUMN_DESCRIPTION(
    ARRAY_AGG(OBJECT_CONSTRUCT('COLUMN_NAME', COLUMN_NAME, 'TYPE', TYPE, 'NULLABLE', NULLABLE)), 'external_table'
) AS COLUMNS
FROM simulated_infer_schema;

WITH simulated_infer_schema AS (
    SELECT 'country' AS COLUMN_NAME, 'VARIANT' AS TYPE, TRUE AS NULLABLE
    UNION ALL
    SELECT 'continent', 'TEXT', TRUE
)
SELECT TRIM(GENERATE_COLUMN_DESCRIPTION(
    ARRAY_AGG(OBJECT_CONSTRUCT('COLUMN_NAME', COLUMN_NAME, 'TYPE', TYPE, 'NULLABLE', NULLABLE)), 'view'
)) AS COLUMNS
FROM simulated_infer_schema;

WITH binary_demo AS (
  SELECT MD5_BINARY('Snowflake') AS b
)
SELECT TO_VARCHAR(b, 'HEX') AS hex_representation
  FROM binary_demo;

WITH double_demo AS (
    SELECT * FROM VALUES
    (1.1, '2.2', TO_VARIANT(3.14))
    AS T(d, v, o)
)
SELECT TO_DOUBLE(d), TO_DOUBLE(v), TO_DOUBLE(o) FROM double_demo;

CREATE OR REPLACE TABLE test_nvarchar (
    id INTEGER,
    unicode_text NVARCHAR(50)
);

EXECUTE IMMEDIATE $$
DECLARE
  v_id INT;
  v_name STRING;
BEGIN
  SELECT 1, 'Alice'
  INTO :v_id, :v_name;
  RETURN v_id || ' ' || v_name;
END;
$$;

CREATE OR REPLACE TABLE test_nchar (
    id INTEGER,
    fixed_unicode NCHAR(10)
);

WITH bad_cte AS (
  SELECT 1
  UNION
  SELECT * FROM bad_cte
)
SELECT * FROM bad_cte;

